import "./App.css";
import HomePage from "./pages/HomePage";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import NavBarComponent from "./includes/NavBarComponent";

function App() {
  return (
    <>
      <BrowserRouter>

        <Routes>
          <Route path="/" elements={<HomePage />}></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
